import React from 'react';
import { Menu } from 'antd';

const { SubMenu } = Menu;

export default function Header() {
	return (
		<Menu mode='horizontal'>
			<Button type='primary' style={{ marginLeft: 8 }}>
				Primary Button
			</Button>
			<Menu.Item>Something</Menu.Item>
		</Menu>
	);
}
